// UserList.jsx
import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { deleteUser } from '../features/users/usersSlice';

const UserList = () => {
  const users = useSelector((state) => state.users.data); // Make sure you're accessing `.data`
  const dispatch = useDispatch();

  return (
    <ul>
      {users.map((user) => (
        <li key={user.id} style={{
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'flex-start',
          marginBottom: '8px'
        }}>
          {user.name}
          <button style={{ backgroundColor: 'lightblue', marginLeft: '10px', marginRight: '10px', minWidth: '60px', textAlign: 'left', color: 'blue' }} onClick={() => dispatch(deleteUser(user.id))}>
            Delete
          </button>
        </li>
      ))}
    </ul>
  );
};

export default UserList;
